    super._burn(_owner, _tokenId); //   _burn   ( removeTokenFrom  )

    // Clear metadata (if any)
    if (bytes(tokenURIs[_tokenId]).length != 0) { // string  bytes      .
      delete tokenURIs[_tokenId]; // tokenURI   
